            border: none;
            font-size: .8rem;
            -webkit-border-radius: 30px;
            -moz-border-radius: 30px;
            border-radius: 30px;
            text-align: center;
            color: $color3;
            padding: 15px 30px;
            text-transform: uppercase;
            width: 100%;
          }
      }
    }

    .contact-section{
      display: inline-block;
      vertical-align: top;
      padding: 56px;
      width: 70%;
      margin: 0 0 1rem;
      float: left;
      .contact-info{
        h1{
          font-size: 2.3rem;
          font-weight: 500;
          line-height: 1.0;
          margin: 0 0 1rem;
          span{
