          }
        }
        .contact-box{
          max-width: 600px;
          padding: 25px;
          transition: all .3s ease-in-out;
          cursor: pointer;
          &:hover{
            border-radius: 3px;
            border-radius: 3px;
            background: #f5f5f5;
            box-shadow: 7px 7px 6px #b8b8b8,
                -7px -7px 6px #ffffff;
          }
          padding: 30px;
          h5{
            font-weight: 500;
            font-size: 1.1rem;
            margin: 0 0 2rem;
          }
          p{
            color: $color4;
            font-weight: 300;
            line-height: 1.4;
            margin: 0 0 2rem;
          }
        }


      }
    }
  }
}

